			addi $s2, $zero, 0
	    
	    j outer
	    
	out2:
	addi $t6, $t6, 128
	addi $s1, $zero, 0
    addi $s0, $s0, 1
    
    j Loop
    nop
    
out: 
	break
	nop	
    
.end _start

